import './App.css';

function NavBar (props) {
  const {ulClassName} = props;
  const {liClassName} = props;
  const features = ["Notre service", "Système de consigne", "Nous contacter"]; 
  return (
    <ul className={ulClassName}>
    {features.map((feature, index) => <li key={index}><a href="#" className={liClassName}>{feature}</a></li>)}
    </ul>
  )
}

function App() {
  return (
    <NavBar ulClassName="navBar" liClassName="feature"/>
  )

}

export default App;


